function dadosRateio() {
  try {

    var indexes = hAPI.getChildrenIndexes("table_rateio_ccusto_fin");
    for (var i = indexes.length - 1; i >= 0; i--) {
      hAPI.removeCardChild("table_rateio_ccusto_fin", indexes[i]);
    }

    var valorTotal = hAPI.getCardValue("valor_total_rateio");
    hAPI.setCardValue("valor_total_rateio_fin", valorTotal);
    var camposProcessoPrincipal = hAPI.getCardData(getValue("WKNumProces"))
    var keys = camposProcessoPrincipal.keySet().toArray();
    for (var key in keys) {
      var field = keys[key];
      if (field.indexOf("coluna_natureza___") >= 0) {
        var novoItem = new java.util.HashMap();
        var idPF = field.replace("coluna_natureza___", "");
        novoItem.put("coluna_natureza_fin", camposProcessoPrincipal.get(String("coluna_natureza" + "___" + idPF)));
        novoItem.put("coluna_ccusto_fin", camposProcessoPrincipal.get(String("coluna_ccusto" + "___" + idPF)));
        novoItem.put("coluna_valor_fin", camposProcessoPrincipal.get(String("coluna_valor" + "___" + idPF)));
        novoItem.put("coluna_percentual_fin", camposProcessoPrincipal.get(String("coluna_percentual" + "___" + idPF)));
        hAPI.addCardChild("table_rateio_ccusto_fin", novoItem);
      }
    }
  } catch (err) {
    log.error("G5 beforeStateEntry: " + String(err));
  }
}

function capta_Cpf_Cnpj(tipo_pessoa) {
  if (tipo_pessoa == "F") {
    return hAPI.getCardValue("CPF_fin");
  }
  if (tipo_pessoa == "J") {
    return hAPI.getCardValue("CNPJ_fin");
  }
}

function servicetask344(attempt, message) {
    //Disparo de email
    log.info('servicetask344 344 rodando...')

    var emails = [hAPI.getCardValue('email_solicitante'), hAPI.getCardValue('copia_email_solicitante')];
    var contentEmail = '';
	contentEmail += '<html>'
	contentEmail += '	<head>'
	contentEmail += '		<meta>'
	contentEmail += '		<meta>'
	contentEmail += '		<meta>'
	contentEmail += '	</head>'
	contentEmail += '	<body>'
	contentEmail += '	<h2> Olá, ' + getValue("WKUser") + '</h2>';
	contentEmail += '	<p> Informamos que a solicitação ' + String(getValue("WKNumProces"))
	contentEmail += '	    foi paga e finalizada !</p>'
    contentEmail += '<br><p>Seguem os comprovantes de pagamento:</p><br>'

    var indexes = hAPI.getChildrenIndexes("table_pagamento_unico")

    for (var i = 0; i < indexes.length; i++){ 
        var attachmentLink = getAttchment(hAPI.getCardValue('anexo_pu___'+indexes[i]))
        if(attachmentLink){
          contentEmail += attachmentLink
        }
    }

    contentEmail += '	</body>'
	contentEmail += '</html>'

    var obj = new com.fluig.foundation.mail.service.EMailServiceBean();

    for(var x = 0; x < emails.length; x++){
        obj.simpleEmail(1, 'Comprovantes do pagamento - Solicitação :' + String(getValue("WKNumProces")), "suportefluig@engpac.com.br", emails[x], contentEmail, "text/html");
    }
}

function getAttchment(description){
    var pageService = fluigAPI.getPageService();
	var urlFluig = pageService.getServerURL();
	var attachments = hAPI.listAttachments();
	for (var i = 0; i < attachments.size(); i++) {
	  var attachment = attachments.get(i);
	  if (attachment.getPhisicalFile() == description) {
          return '<p><a href="' + urlFluig + '/portal/p/1/ecmnavigation?app_ecm_navigation_doc=' + attachment.getDocumentId() + '">' + attachment.getDocumentDescription() + '</a></p><br>'
	  }
	}
}

